import React from 'react';
import './Main.css'

//components
import Section from './Section/Section';
import Blurb from './Blurbs/Blurb';


const Main = () => {
    return (
    <div className="container">
        <Section id='aboutme'
        title='About Me'
        children={<Blurb title={this.title}/>}/>
        <Section id='skills' title='Skills' children={<Blurb/>}/>
        <Section id='projects' title='Projects' children={<Blurb/>}/>
    </div>
    );
}

export default Main;
